import styled from "@emotion/styled";

export const OrderItemWrapper = styled('div')`
    position: relative;
    width: 100%;

    .wrapper_inner {
        position: relative;
        width: 100%;
        display: flex;
        flex-direction: column;

        .order_box {
            position: relative;
            width: 100%;
            display: flex;
            flex-direction: column;
            padding-bottom: 20px;
            margin-top: 20px;
            border-bottom: 1px dashed #7a7a7a;

            .top_box {
                position: relative;
                width: 100%;
                display: flex;
                align-items: center;

                .content_left {
                    position: relative;
                    width: 150px;
                    height: 100px;
                    display: flex;
                    border-radius: 8px;
                    margin-right: 25px;

                    img {
                        position: relative;
                        width: 100%;
                        height: 100%;
                    }
                }

                .content_right {
                    position: relative;
                    width: calc(100% - 150px);
                    display: flex;
                    flex-direction: column;

                    .top_content {
                        position: relative;
                        width: 100%;
                        display: flex;
                        margin-bottom: 5px;

                        h5 {
                            position: relative;
                            font-size: 19px;
                            font-weight: 600;
                            color: #000;
                            font-family: "SUSE", sans-serif;
                        }
                    }

                    .bottom_content {
                        position: relative;
                        width: 100%;
                        display: flex;
                        justify-content: space-between;

                        a {
                            position: relative;
                            font-size: 13px;
                            color: #555;
                            font-family: 'Poppins', sans-serif;
                        }

                        p {
                            position: relative;
                            font-size: 14px;
                            color: #000;
                            font-family: 'Poppins', sans-serif;

                            span {
                                color: #555;
                            }

                        }
                    }
                }
            }

            .bottom_box {
                position: relative;
                width: 100%;
                display: flex;
                align-items: center;
                justify-content: space-between;
            }
        }
    }    
`;
